(
  id         INTEGER not null,
  username   VARCHAR2(40),
  password   VARCHAR2(100),
  createtime DATE
)
tablespace MYSPACE
  pctfree 10
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
alter table H_TIGER
  add primary key (ID)
  using index 
  tablespace MYSPACE
  pctfree 10
  initrans 2
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );

